class Navbar extends Component {
    state = { 
        forma : "nav-bar fixed-top"
     }

    handlerNav = (e) => {
        e.preventDefault()
        this.setState({forma :"nav-bar-circulo fixed-top"})
    }
    render() {
        return ( 
            <div className={this.state} onMouseOver={this.handlerNav}>
            <h5>Who i am</h5>
            <h5>Skills</h5>
            <h5>Studies</h5>
            <h5>Contact me</h5>
        </div>
         );
    }
}

export default Navbar;
